import React, { useRef, useEffect, useState } from 'react';
import Webcam from 'react-webcam';
import RunPoseMesh from './components/RunPoseMesh'; // Assuming this is the correct component name
import './App.css';

function App() {
  const [webcamRef, setWebcamRef] = useState(null);
  const [canvasRef, setCanvasRef] = useState(null);

  useEffect(() => {
    const [webcamRefFromComponent, canvasRefFromComponent] = RunPoseMesh(); // Destructure returned refs
    setWebcamRef(webcamRefFromComponent); // Set webcamRef state with the returned ref
    setCanvasRef(canvasRefFromComponent); // Set canvasRef state with the returned ref
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <Webcam
          audio={false} // Disable audio for webcam
          ref={webcamRef}
          style={{
            position: "absolute",
            marginLeft: "auto",
            marginRight: "auto",
            left: 0,
            right: 0,
            textAlign: "center",
            zIndex: 9,
            width: 640,
            height: 480,
          }}
        />
        <canvas
          ref={canvasRef}
          style={{
            position: "absolute",
            marginLeft: "auto",
            marginRight: "auto",
            left: 0,
            right: 0,
            textAlign: "center",
            zIndex: 9,
            width: 640,
            height: 480,
          }}
        />
      </header>
    </div>
  );
}

export default App;
